  imports: [
    BrowserModule,
    AppRoutingModule,
    KeycloakAngularModule
  ],
  providers: [

    provideKeycloak({
      config: {
        url: 'https://your-keycloak-server/auth',
        realm: 'your-realm',
        clientId: 'your-client-id',
      },
      initOptions: {
        onLoad: 'login-required',
        checkLoginIframe: false
      },
    }),
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
